  input: TEXT,"F3XA","","Please note that this is a conforming amendment to carry
    through corrections made to reports filed during the 2004 election cycle. Receipts
    reported on Schedule A for Line 17, unless otherwise noted, are for the purchase
    of access to the Committee's voter file. The Committee believes that this price
